import styled from 'styled-components'
import Logo from '../components/logo'
import '../styles/theme.css'

const SubnavItem = ({className, children, src}) => (
    <SubnavItemStyles className={className}>
      <Logo src={src}/>
      <span>{children}</span>
    </SubnavItemStyles>
);

const SubnavItemStyles = styled('div')`
  display: grid;
  grid-template-columns: 16px auto;
  gap: 8px;
  align-items: center;
`;

export default SubnavItem;
